				43A68B99110685E5000A153F /* ossimplanet2-Info.plist */,
			);
			comments = "ossimPlanet is being initially developed on the OSX platform with the XCode developer tools.\nThe easiest way to get up and running is to install the latest binary installer. During initial development, a fairly recent version of the software will be available at http://ossim.telascience.org/ossimdata . Look for and download the dmg file which will should mount after download. (e.g. rc4_earth_viz.mpkg.dmg ) Double click the package installer and the libararies and frameworks will be installed in standard locations:\nFor development you can download the dmg/installer packages for OpenSceneGraph (1.2 or greater) and qt (4.1) (which will include the development headers). Follow the installation instructions listed on those sites to install the dependencies.\nNote: with the initial OpenSceneGraph 1.2 dmgs you will need to rename the osgdb_flt.so plugin to osgdb_OpenFlight.so to get open flight models to work correctly. This may be fixed in the release by the time you get this.\nFollow the cvs instructions to checkout the source code trees.\nThe MacOSX build is performed with xcode. It assumes that all of the cvs subtrees have been checked out per the cvs instructions and are sitting side by side in your development directory. Navigate into the ossim subdirectory and load the xcode project\n  YourDevelopmentDirectory/ossim/xcode/ossim/ossim.xcodeproj\nLoading this project into xcode will reveal Targets and subtargets that will build all of the ossim related frameworks and apps. It assumes that OpenSceneGraph frameworks have been copied into place (/Library/Frameworks) and qt 4 is installed on the system.\n\n\nCurrently the xcode project builds it against qt3, If you are building universals using the 10.4 sdk you will need to create a symbolic link.\ncd /Developer/SDKs/MacOSX10.4u.sdk/Developer\nsudo ln -s /Developer/qt .";
